/**
 * Created by Lenovo on 2019/8/10.
 */
import React from 'react';
import './personal.css';
import right from '../../images/personal/right.png';
import avatar from '../../images/personal/avatar.jpg';
import {Title} from '../../share';
import {getData, goNext} from '../../utils';
export default class Publish extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            account: '',
            password: '',
        }
    }
    render() {
        return <div>
        <Title title="个人中心" isHome={true}/>
        <div className="cm-mlr-15">
            <div className="cm-mlr-15 cm-mtb-20">
                <img src={avatar} alt="" className="cm-img-mid"/>
                <div>
                    <div className="cm-fw-bold">杏子</div>
                    <div className="cm-c-999">当前卖出累计金额<span className="cm-c-main cm-ml-10">12</span></div>
                </div>
            </div>
            <div className="cm-line"></div>
            <div className="cm-item cm-jc-sb">
                <div>
                    <img src="" alt=""/>
                    <span className="cm-c-333">我发布的</span>
                </div>
                <div><span className="cm-c-999">0</span><img src={right} alt=""/></div>
            </div>
            <div className="cm-item cm-jc-sb">
                <div>
                    <img src="" alt=""/>
                    <span className="cm-c-333">我发布的</span>
                </div>
                <div><span className="cm-c-999">0</span><img src={right} alt=""/></div>
            </div>
            <div className="cm-tx-c"><span className="cm-btn-small">安全退出</span></div>
        </div>
        </div>
    }
}
